// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

contract Consumer{
   function getBalance() public view returns(uint){
      return address(this).balance;
   }

   function deposit () public payable{

   }
}

contract SmartContracWallet{
 address payable public  owner;
 mapping(address => uint) public allowance;
 mapping (address => bool) public isAllowedToSend;
 mapping(address => bool) public guardians;
 address payable nextOwner;
 mapping(address => mapping(address => bool)) public nextOwnerGuardianVotedBool;
 uint guardiansResetCount;
 uint public constant confirmationsFromGuardiansForReset = 3;



 constructor() {
    owner = payable(msg.sender);
 }

 function setGuardian(address _guardian, bool _isGuardian) public {
   require(msg.sender == owner, "You are not the owner, aborting");
   guardians[_guardian] = _isGuardian;
 }


 function proposeNewOwner(address payable _newOwner) public{
  require(guardians[msg.sender],"You are not guardian of this wallet, aborting!!");
  require(nextOwnerGuardianVotedBool[_newOwner][msg.sender] == false, "You already voted, aborting");
  if(_newOwner != owner){
   nextOwner = _newOwner;
   guardiansResetCount = 0;
  }
   guardiansResetCount++;

   if(guardiansResetCount >=  confirmationsFromGuardiansForReset){
      owner = nextOwner;
      nextOwner = payable(address(0));
   }
 }


 function setAllowance(address _for, uint _amount) public{
  require(msg.sender == owner, "You are not the owner, aborting");
  allowance[_for] = _amount;

  if(_amount > 0){
   isAllowedToSend[_for] = true;
  }else{
   isAllowedToSend[_for] = false;
  }


 }

//the payload can be copied from the input value of the Consumer contract when your run the deposit function, you will see the byte representation of the function input at the bottom of the IDE
function transfer(address payable _to, uint _amount, bytes memory _payload) public returns(bytes memory){
    require(msg.sender == owner, "You are not the owner, aborting!!");
    if(msg.sender != owner){
     require(allowance[msg.sender] >= _amount,"You are trying to send more than you are allowed to, aborting!!");
     require(isAllowedToSend[msg.sender], "You are not allowed to send anything from this smart contract, aborting!!");

     allowance[msg.sender] -= _amount;
    }

   (bool success, bytes memory returnData) =  _to.call{value: _amount}(_payload);
   require(success,"Aborting, call was not successful");
   return  returnData;
} 

receive() external payable { }
}

